import './App.css';
import Header from './component/Header';
import Body from './component/Body';
import Footer from './component/Footer';
import { Button, Modal } from 'react-bootstrap';
function App() {
  return (<div >
    <Button>bootstrap</Button>
    <Modal show={true}>
      <Modal.Header>
        hi
      </Modal.Header>
      <Modal.Body>
        body
      </Modal.Body>
      <Modal.Footer>
        Footer
      </Modal.Footer>
    </Modal>
    <Header className='header' />
    <Body />
    <Footer />
  </div>

  );
}

export default App;
